    description: 'I got this for 50 cents in a little vending machine at a rest stop in November 2007. It is an egg that opens up and you pull out the neck, tail, and legs of a dinosaur and close the egg to make its body. The cool thing is in the 1980s there was a series of Masters of the Universe toys called Meteorbs and of course I had the one that was a dinosaur. It was purple and called Dinosorb I think. I still have it at my parents house - and this yellow toy looks like it is made from the same mold. Its exactly the same except for the little ring you can put a string through at the base of its neck.'
