  Collectible_75117:
    graph_id: '20428'
    collector_id: Collector_12
    name: 'Time Warp Pinball : 1979'
    slug: time-warp-pinball-1979-7569e5
    description: "This Williams' machine from 1979 is pretty awesome! <br /><br />I obtained this from\r\n a local collector, and after months of tinkering, I just couldn't get \r\nthe sound to work. This version does NOT have the unique banana \r\nflippers, but traditional straight flippers instead. I bought this \r\nbecause the price was right and the graphics were incredible. All of the\r\n body graphics are still intact. <br /><br />I love this machine, and the time \r\ntravel theme (dinosaurs, astronauts, cavemen, knights, egyptians, and a \r\nton of other awesome details), but I'm out of space!\r\nMachine is in good condition. While the sound doesn't work, everything \r\nelse functions excellently &amp; turns on with no problem. Internal \r\nplastics look fine (awesome Egyptian bumpers!), though there's a \r\npossibility that I could have missed something, as I'm a relative \r\namateur. <br /><br />Known flaws include :<br />&nbsp;- Like most older machines, it needs to be cleaned inside and out.<br />- \r\nBackglass isn't perfect. Has scraping / peeling areas around edges, but \r\nit doesn't really interfere with the graphics.<br />- Wooden body has gouges, \r\nand two large holes drilled in the front (originally, to lock the coin \r\nbox down).\r\n<br /><br />So, it's time to part ways with this machine. Only 8,875 units were ever\r\n made, and it comes with a very high rating from the International \r\nPinball database!\r\nBecause of the size of the machine, it's local pickup ONLY, and I'm \r\nlocated within the Hudson Valley. You supply the tools (unbolt the legs \r\n&amp; upper portion), and I'll help you get it to the truck!\r\nMore pics available upon request!\r\nhttp://www.ipdb.org/machine.cgi?gid=2568<br />"
    batch_hash: 731f89ec020a5c0dab012d4fc13fa173
    num_views: '469'
